void reorder_img(void) {
    for(uint8_t i = 0; i<100; i++) {
        for(uint8_t j = 0; j<100; j++) {
            display_color_buffer[i][j] =   TO_BIG_ENDIAN_16( display_color_buffer[i][j] );
        }  
    }
}

void shift_and_reorder(uint8_t color_shift, bool is_big_endian) {
        uint16_t col = 0xF000;
        col = col >> color_shift;
        for(uint8_t j = 0; j<100; j++) {
            for(uint8_t k = 0; k<100; k++) {
                display_color_buffer[j][k] = is_big_endian ? TO_BIG_ENDIAN_16( col ) : col;
            }  
        }
}

void display_cmd(uint8_t cmd) {
    gpio_set_level(PIN_DC, 0);
    spi_transaction_t spi_tx = {
        .length = 8,
        .tx_buffer = &cmd,
    };
    esp_err_t ret = spi_device_transmit(spi, &spi_tx);
    if (ret != ESP_OK) {
        ESP_LOGE("SPI", "Error transmitting command at display_cmd: %d %s", cmd, esp_err_to_name(ret));
    }
}

void display_data(const uint8_t *data, size_t length) {
    gpio_set_level(PIN_DC, 1);
    spi_transaction_t spi_tx = {
        .length = length * 8,
        .tx_buffer = data,
    };
    spi_device_transmit(spi, &spi_tx);
}

void display_reset(void) {
    gpio_set_level(PIN_RST, 0);
    vTaskDelay(pdMS_TO_TICKS(100));
    gpio_set_level(PIN_RST, 1);
    vTaskDelay(pdMS_TO_TICKS(100));
}

void display_init(void) {
    display_cmd(DSPL_MEMORY_ACCESS_CONTROL);
    uint8_t mactl_data[] = {0xC0};
    display_data(mactl_data, sizeof(mactl_data));
    
    display_cmd(DSPL_COLOR_FORMAT);
    uint8_t color_data[] = {0x05};
    display_data(color_data, sizeof(color_data));

    display_cmd(DSPL_INVERSION_ON);
    display_cmd(DSPL_SLEEP_OUT);
    vTaskDelay(pdMS_TO_TICKS(150)); 
    display_cmd(DSPL_ON);
    vTaskDelay(pdMS_TO_TICKS(3000));
}

void set_color(uint16_t color, bool is_big_endian) {
    for(uint8_t j = 0; j<100; j++) {
        for(uint8_t k = 0; k<100; k++) {
            display_color_buffer[j][k] = is_big_endian ? TO_BIG_ENDIAN_16( color ) : color;
        }  
    }
}

void setup_display_config(void) {
    gpio_set_direction(PIN_DC, GPIO_MODE_OUTPUT);
    gpio_set_direction(PIN_RST, GPIO_MODE_OUTPUT);
    spi_bus_config_t buscfg = {
        .mosi_io_num = PIN_MOSI,
        .miso_io_num = -1,
        .sclk_io_num = PIN_CLK,
        .quadwp_io_num = -1,
        .quadhd_io_num = -1,
    };
    spi_bus_initialize(SPI2_HOST, &buscfg, SPI_DMA_CH_AUTO);

    spi_device_interface_config_t devcfg = {
        .clock_speed_hz = 20 * 1000 * 1000,
        .mode = 3,
        .spics_io_num = PIN_CS,
        .queue_size = 7,
    };
    spi_bus_add_device(SPI2_HOST, &devcfg, &spi);
}

void display_address_window(
    uint16_t start_x, 
    uint16_t start_y, 
    uint16_t end_x, 
    uint16_t end_y) {
    
    uint8_t window_data[4];
    display_cmd(DSPL_COLUMN_ADDRESS_SET);
    //converting to big endian
    window_data[0] = start_x >> 8;
    window_data[1] = start_x & 0xFF;
    window_data[2] = end_x >> 8;
    window_data[3] = end_x & 0xFF;
    
    display_data(window_data, 4);
    
    display_cmd(DSPL_ROW_ADDRESS_SET);
    window_data[0] = start_y >> 8;
    window_data[1] = start_y & 0xFF;
    window_data[2] = end_y >> 8;
    window_data[3] = end_y & 0xFF;

    display_data(window_data, 4);

    display_cmd(DSPL_MEMORY_WRITE);
}

void display_write_color(uint16_t color, uint32_t length) {
    //uint8_t data[] = { color >> 8, color & 0xFF };
    // for(uint8_t i = 0; i<100; i++) {
    //     display_color_buffer[i]= color;
    // }

    gpio_set_level(PIN_DC, 1);
    for(uint32_t i = 0; i<100; i++) {
        spi_transaction_t spi_tx = {
            .length = 16*100,
            .tx_buffer = display_color_buffer[i],
        };
        esp_err_t ret = spi_device_transmit(spi, &spi_tx);
        if (ret != ESP_OK) {
            ESP_LOGE("SPI", "Error transmitting data: %s", esp_err_to_name(ret));
        }
    }
}

void display_img(uint16_t img_buffer[100][100], 
    uint8_t x,  
    uint8_t y, 
    uint8_t width, 
    uint8_t height) {
    display_address_window(x, y, width - 1, height - 1);
    gpio_set_level(PIN_DC, 1);
    for(uint32_t i = 0; i<width; i++) {
        spi_transaction_t spi_tx = {
            .length = 16 * 100,
            .tx_buffer = img_buffer[i],
        };
        esp_err_t ret = spi_device_transmit(spi, &spi_tx);
        if (ret != ESP_OK) {
            ESP_LOGE("SPI", "Error transmitting data: %s", esp_err_to_name(ret));
        }
    }
}

void display_fill(uint16_t color) {
    uint16_t width = 100;
    uint16_t height = 100;
    display_address_window(0, 0, width - 1, height - 1);
    display_write_color(color, height);
}

void display_animation() {
    ESP_LOGI("Display", "Starting animation");
  
    display_img(display_color_buffer, 5, 5, 105, 105);
    vTaskDelay(pdMS_TO_TICKS(300));
    display_img(display_color_buffer, 10, 10, 110, 110);
    vTaskDelay(pdMS_TO_TICKS(300));
    display_img(display_color_buffer, 15, 15, 115, 115);
    vTaskDelay(pdMS_TO_TICKS(300));
    display_img(display_color_buffer, 10, 15, 110, 115);
    vTaskDelay(pdMS_TO_TICKS(300));
    display_img(display_color_buffer, 5, 15, 105, 115);
    vTaskDelay(pdMS_TO_TICKS(300));
    display_img(display_color_buffer, 10, 20, 110, 120);
    vTaskDelay(pdMS_TO_TICKS(300));
    display_img(display_color_buffer, 15, 20, 115, 120);
    vTaskDelay(pdMS_TO_TICKS(300));
    display_img(display_color_buffer, 15, 25, 115, 125);
    vTaskDelay(pdMS_TO_TICKS(300));
}



void app_main(void)
{
    uint16_t *whole_screen_buffer = heap_caps_malloc(sizeof(uint16_t) * SCREEN_WIDTH * SCREEN_HEIGHT, MALLOC_CAP_DMA);
    reorder_img();
    gpio_reset_pin(BLINK_GPIO);
    gpio_set_direction(BLINK_GPIO, GPIO_MODE_OUTPUT);

    gpio_reset_pin(BLINK2_GPIO);
    gpio_set_direction(BLINK2_GPIO, GPIO_MODE_OUTPUT);

    gpio_set_pull_mode(BLINK_GPIO, GPIO_PULLDOWN_ONLY);   

    ledc_timer_config_t ledc_timer = {
        .speed_mode = LEDC_LOW_SPEED_MODE,
        .duty_resolution = LEDC_TIMER_8_BIT,
        .timer_num = LEDC_TIMER_0,
        .freq_hz = 1000, 
        .clk_cfg = LEDC_AUTO_CLK,
    };

    ledc_timer_config(&ledc_timer);

    ledc_channel_config_t ledc_channel = {
        .speed_mode = LEDC_LOW_SPEED_MODE,
        .channel = LEDC_CHANNEL_0,
        .timer_sel = LEDC_TIMER_0,
        .intr_type = LEDC_INTR_DISABLE,
        .gpio_num = LED_STRIPE_1_PWM,
        .duty = 128, 
        .hpoint = 0,
    };

    // PWM channel conf
    ledc_channel_config(&ledc_channel);

    setup_display_config();
    display_reset();
    display_init();
    display_animation();

   

    while (1) {
        gpio_set_level(BLINK_GPIO, 1);
        vTaskDelay(pdMS_TO_TICKS(750)); 
        
        gpio_set_level(BLINK_GPIO, 0);
        vTaskDelay(pdMS_TO_TICKS(200)); 

        gpio_set_level(BLINK_GPIO, 1);
        vTaskDelay(pdMS_TO_TICKS(100)); 

        gpio_set_level(BLINK2_GPIO, 1);
        gpio_set_level(BLINK_GPIO, 0);
        vTaskDelay(pdMS_TO_TICKS(100)); 
        

        gpio_set_level(BLINK2_GPIO, 0);
        gpio_set_level(BLINK_GPIO, 1);
        vTaskDelay(pdMS_TO_TICKS(200)); 
        

        gpio_set_level(BLINK2_GPIO, 1);
        gpio_set_level(BLINK_GPIO, 0);
        vTaskDelay(pdMS_TO_TICKS(200)); 

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 10);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(100));

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 20);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(100));

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 30);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(100));

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 100);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(200));

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 180);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(400));

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 200);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(300));

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 180);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(400));

        ledc_set_duty(ledc_channel.speed_mode, ledc_channel.channel, 100);
        ledc_update_duty(ledc_channel.speed_mode, ledc_channel.channel);
        vTaskDelay(pdMS_TO_TICKS(200));

        display_animation();

        vTaskDelay(pdMS_TO_TICKS(200));

       

    }
}
